webpackJsonp([98429209067524],{581:function(e,n){e.exports={data:{markdownRemark:{html:"<p>Your father was a railroad man<br>\nWine glass fixed in his hand<br>\nBack then this land was their land<br>\nAmelia  </p>\n<p>Little red plane swishing by<br>\nCries, rise above the rock island line<br>\nIn the air your heart must fly<br>\nAmelia  </p>\n<p><em>Amelia, watching her go</em><br>\n<em>Casting a shadow on the water below</em><br>\n<em>Singing a song on Noah's great rainbow</em><br>\n<em>How much they love you Amelia you'll never know</em>  </p>\n<p>Traveling with nothing except her wit<br>\nHershey bar and two handkerchiefs<br>\nAll just to get a little more lift<br>\nAmelia  </p>\n<p>Smiling stepping onto the ground<br>\nFlash photography all around<br>\nCatching the queen of the air being crowned<br>\nAmelia  </p>\n<p><em>Amelia, watching her go</em><br>\n<em>Casting a shadow on the water below</em><br>\n<em>Singing a song on Noah's great rainbow</em><br>\n<em>How much they love you Amelia you'll never know</em>  </p>\n<p>Spark so bright and wick so short<br>\nLonesome Bessie the Fire Horse<br>\nRealized that she'll never soar<br>\nWithout Amelia  </p>\n<p>Every year on The Fourth of July<br>\nI hear a hollering in the sky<br>\nAlmost can see her wobbling by<br>\nAmelia  </p>\n<p><em>Amelia, watching her go</em><br>\n<em>Casting a shadow on the water below</em><br>\n<em>Singing a song on Noah's great rainbow</em><br>\n<em>How much they love you Amelia you'll never know</em>  </p>",frontmatter:{title:"Amelia"},fields:{date:null}}},pathContext:{slug:"/songs/amelia/"}}}});
